import React, { Component } from 'react';
import Nav from './Nav';
import Section from './Section';
import Footer from './Footer';
import './App.css';

class App extends Component {
  render() {
    return (
      <html>
      <head>
        <title>PreMedical Something</title>
      </head>
      <Nav />
      <body>
        <Section />
      </body>
      <footer>
        <Footer />
      </footer>
      </html>


    );
  }
}

export default App;
